import classes from "./SearchPopup.module.css";
const SearchPopup = () => {
  return (
    <div className={classes.popup}>
      <h1>Search</h1>
      <form>
        <div className={classes.search}>
          <p>Destination</p>
          <input></input>
        </div>
        <div className={classes.search}>
          <p>Check-in-Date</p>
          <input></input>
        </div>

        <p>Options</p>
        <div>
          <label>Min Price</label>
          <input></input>
        </div>
        <div>
          <label>Max Price</label>
          <input></input>
        </div>
        <div>
          <label>Aldult</label>
          <input></input>
        </div>
        <div>
          <label>Children</label>
          <input></input>
        </div>
        <div>
          <label>Room</label>
          <input></input>
        </div>
      </form>
    </div>
  );
};
export default SearchPopup;
